        "    checkpoint = tf.keras.callbacks.ModelCheckpoint(save_dir+get_model_name(fold_var),\n",
        "                            monitor='val_accuracy', verbose=1,\n",
        "                            save_best_only=True, mode='max')\n",
        "    callbacks_list = [checkpoint]\n",
        "\n",
        "\n",
        "    # Model Checkpoint\n",
